  \"Ocean currents measured by Shipboard Acoustic Doppler Current Profiler (SADCP)
  from global oceans as part of the Joint Archive for SADCP holdings from 20 August
  1999 to 13 May 2009 (NODC Accession 0067774)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:49.572377\",\n\t\"name\": \"ocean-currents-measured-by-shipboard-acoustic-doppler-current-profiler-sadcp-from-global-o-4b3fb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Absolute U- and V-component ocean current
  vectors from Shipboard Acoustic Doppler Current Profilers (SADCP), as both a high-frequency
  sampling (nominally 5 minutes with 8 m depth bins) and an averaged subset (hourly
  time and 10 m depth means), are provided for the global oceans. The depth range
  is typically from 20 to 300 m although recent technology has allowed penetration
  to over 1 km. The high frequency samples along with ancillary parameters are provided
  in the Common Oceanographic Data Access System (CODAS) binary format. The standard
  (averaged) subset is stored in ASCII. These data, collected from 20 August 1999
  to 13 May 2009, represent the cruises acquired from January 2009 through September
  2010 at the Joint Archive for SADCP, a collaboration of NOAA and the E.Firing ADCP
  Laboratory at the University of Hawaii. The data have been contributed by both US
  and international organizations. A total of 251 unique SADCP sets on 16 ships (2.7
  gigabytes) are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
